import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  NavLink
} from "react-router-dom";
import Home from './pages/Home';
import './App.scss';

function App() {
  return (
    <div id="App">
      <header className="header">
        <img className='logo' src='./img/flower-logo.png' alt='logo' />
        <NavLink exact to="/" activeClassName="selected">
          Projects
        </NavLink>
        <NavLink to="/about">
          About
        </NavLink>
        <NavLink to="/contact">
          Contact
        </NavLink>
      </header>
      <Router>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/projects/:id" />
          <Route path="/about" />
          <Route path="/contact" />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
